import { registerRoutes } from "./routes";
import { setupVite, serveStatic, log } from "./vite";
import { schedulerService } from "./services/scheduler";
import type { JsonValue } from "./types/json";

const app = express();

declare module 'http' {
  interface IncomingMessage {
    rawBody: unknown
  }
}
app.use(express.json({
  verify: (req, _res, buf) => {
    req.rawBody = buf;
  }
}));
app.use(express.urlencoded({ extended: false }));

// CHANGE: Capture API responses with JsonValue-aware buffer so logging never relies on `any`.
// WHY: Response bodies are JSON serializable by invariant, so JsonValue keeps typing precise without violating lint rules.
// QUOTE(TЗ): "Никогда не использовать `any`, `unknown`, `eslint-disable`, `ts-ignore`."
// REF: user-msg-2025-02-15-1
// SOURCE: n/a
app.use((req, res, next) => {
  const start = Date.now();
  const path = req.path;
  let capturedJsonResponse: JsonValue | undefined;

  const originalResJson = res.json;
  res.json = function (bodyJson, ...args) {
    capturedJsonResponse = bodyJson;
    return originalResJson.apply(res, [bodyJson, ...args]);
  };

  res.on("finish", () => {
    const duration = Date.now() - start;
    if (path.startsWith("/api")) {
      let logLine = `${req.method} ${path} ${res.statusCode} in ${duration}ms`;
      if (capturedJsonResponse) {
        logLine += ` :: ${JSON.stringify(capturedJsonResponse)}`;
      }

      if (logLine.length > 80) {
        logLine = logLine.slice(0, 79) + "…";
      }

      log(logLine);
    }
  });

  next();
});

(async () => {
  const server = await registerRoutes(app);

  // CHANGE: Introduced explicit ExpressError structural type to avoid `any` in error middleware.
  // WHY: Error handlers rely on optional status/statusCode properties; dedicated type asserts invariant without disabling checks.
  // QUOTE(TЗ): "Никогда не использовать `any`, `unknown`, `eslint-disable`, `ts-ignore`."
  // REF: user-msg-2025-02-15-1
  // SOURCE: n/a
  type ExpressError = Error & { status?: number; statusCode?: number };

  app.use((err: ExpressError, _req: Request, res: Response, _next: NextFunction) => {
    const status = err.status ?? err.statusCode ?? 500;
    const message = err.message || "Internal Server Error";

    res.status(status).json({ message });
    throw err;
  });

  // importantly only setup vite in development and after
  // setting up all the other routes so the catch-all route
  // doesn't interfere with the other routes
  if (app.get("env") === "development") {
    await setupVite(app, server);
  } else {
    serveStatic(app);
  }

  // ALWAYS serve the app on the port specified in the environment variable PORT
  // Other ports are firewalled. Default to 5000 if not specified.
  // this serves both the API and the client.
  // It is the only port that is not firewalled.
  // CHANGE: Access PORT via bracket notation to respect ProcessEnv index signature under TS4111.
  // WHY: The invariant "env is a Record<string, string | undefined>" forbids dot-property reads of unknown keys.
  // QUOTE(TЗ): "Можешь исправить ошибки в коде"
  // REF: user-msg-2025-02-14-3
  // SOURCE: n/a
  const port = parseInt(process.env["PORT"] || "5000", 10);
  server.listen({
    port,
    host: "0.0.0.0",
    reusePort: true,
  }, () => {
    log(`serving on port ${port}`);
    schedulerService.start();

    // Start workflow scheduler worker for TimerNode delayed execution
    import("./services/scheduler-worker").then(({ schedulerWorker }) => {
      schedulerWorker.start();
      console.log("[Init] Workflow scheduler worker started");
    });
  });
})();
